                    </Li> */}
                    <NavUl>
        <NavLi>고객센터</NavLi>
        <NavLi>관심상품</NavLi>
        <NavLi>마이페이지</NavLi>
        {token ? (
          <NavLi onClick={logoutToken}>로그아웃</NavLi>
        ) : (
          <NavLi onClick={() => navigate('/login')}>로그인</NavLi>
        )}
      </NavUl>
                </nav>
            </div>
        </div>
    );
}
